const routes = require('next-routes')();

routes
//.add('/update', '/update')
.add('/user/details/:headerToken', '/user/details')
.add('/home/:headerToken', '/')
.add('/home/:headerToken/shops/:address', '/shops/show')
.add('/home/:headerToken/shops/record/:address', '/shops/record')
// .add('/:headerToken/shops/:address/payment', '/shops/payment')


module.exports = routes;
